"use client";

class AutumnClientError extends Error {
  code;
  constructor({ message, code }) {
    super(message);
    this.code = code;
  }
  toString() {
    return `${this.message} (${this.code})`;
  }
  toJSON() {
    return {
      message: this.message,
      code: this.code
    };
  }
}
export {
  AutumnClientError
};
